import React from 'react'
import styled from '@emotion/styled'

const Button = styled.button`
  color: turquoise;
`

export default () => (
  <form>
    {' '}
    <input
      type='search'
      placeholder='Enter one of game types V75, V65, V64, V4'
      css={{
        color: 'hotpink'
      }}
    />
    <Button type='submit'>Search</Button>
  </form>
)
